import { Form } from "react-router-dom";

const SearchForm = () => {
  return (
    <div className="searchform">

          <div>
            <Form method="post" action="/movies">
              <label>
                <input
                  type="text"
                  name="search"
                  placeholder="search for movie..."
                  autoComplete="off"
                />
              </label>
              <button className="search-btn">Search</button>
            </Form>
          </div>
        </div>

  );
};

export default SearchForm;
